import React, { useState } from 'react';
import { useLocation } from 'react-router-dom';
import TrainCode from './TrainCode';
import LocationBasedList from './LocationBasedList';
import TrainList from './TrainList';
import DummyLocationBasedList from './DummyLocationBasedList';
import RecommendedPlaces from './RecommendedPlaces';

const TravelDetails = () => {
  const location = useLocation();
  const params = new URLSearchParams(location.search);
  const startDate = params.get('startDate');
  const endDate = params.get('endDate');
  let departure = params.get('departure');
  let destination = params.get('destination');
  let destination2 = params.get('destination');

  const regionMapping = {
    "서울": "1",
    "인천": "2",
    "대전": "3",
    "대구": "4",
    "광주": "5",
    "부산": "6",
    "울산": "7",
    "세종": "8",
    "경기도": "31",
    "강원도": "32",
    "충청북도": "33",
    "충청남도": "34",
    "경상북도": "35",
    "경상남도": "36",
    "전라북도": "37",
    "전라남도": "38",
    "제주도": "39"
  };

  const [selectedTrains, setSelectedTrains] = useState([]);
  const [selectedItems, setSelectedItems] = useState({
    attractions: [],
    hotels: [],
    restaurants: [],
  });

  const departureCodes = TrainCode[departure] || [];
  const destinationCodes = TrainCode[destination] || [];

  // destination 값을 rnum 값으로 변환
  if (regionMapping[destination2]) {
    destination2 = regionMapping[destination2];
  }

  const formatDate = (datetime) => {
    if (typeof datetime !== 'string') {
      datetime = datetime.toString();
    }
    const year = datetime.substring(0, 4);
    const month = datetime.substring(4, 6);
    const day = datetime.substring(6, 8);
    const hour = datetime.substring(8, 10);
    const minute = datetime.substring(10, 12);
    return `${month}월 ${day}일 ${hour}시 ${minute}분`;
  };

  return (
    <div>
      <h2>Travel Details</h2>
      <p><strong>Departure:</strong> {departure}</p>
      <p><strong>Destination:</strong> {destination}</p>
      <p><strong>Start Date:</strong> {startDate}</p>
      <p><strong>End Date:</strong> {endDate}</p>

      <LocationBasedList destination={destination} />
      <DummyLocationBasedList destination2={destination2} />

      {departureCodes.length > 0 && destinationCodes.length > 0 && (
        <TrainList
          depPlaceId={departureCodes}
          arrPlaceId={destinationCodes}
          startDate={startDate}
          selectedTrains={selectedTrains}
          setSelectedTrains={setSelectedTrains}
        />
      )}

      <h1>Selected Trains</h1>
      <div className="selected-items">
        {selectedTrains.map((train) => (
          <div key={train.uniqueId} className="card">
            <p><strong>{train.traingradename}</strong></p>
            <p>출발: {train.depplacename}역 {formatDate(train.depplandtime)}</p>
            <p>도착: {train.arrplacename}역 {formatDate(train.arrplandtime)}</p>
            <p>요금: {train.adultcharge}원</p>
            <p>열차번호: {train.trainno}</p>
            <button onClick={() => setSelectedTrains(selectedTrains.filter(t => t.trainno !== train.trainno))}>삭제</button>
          </div>
        ))}
      </div>

      <style jsx>{`
        .selected-items {
          display: flex;
          flex-wrap: wrap;
          gap: 20px;
        }
        .card {
          border: 1px solid #ccc;
          padding: 10px;
          border-radius: 5px;
          box-shadow: 2px 2px 6px rgba(0, 0, 0, 0.1);
          width: 250px;
        }
        .card p {
          margin: 5px 0;
        }
        .card button {
          background-color: #f44336;
          color: white;
          border: none;
          padding: 5px 10px;
          border-radius: 3px;
          cursor: pointer;
        }
        .card button:hover {
          background-color: #d32f2f;
        }
      `}</style>
    </div>
  );
};

export default TravelDetails;
